import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import LoginPage from "./pages/LoginPage";
import SignupPage from "./pages/SignupPage";
import Home from "./pages/Home";
import AdminDashboard from "./pages/AdminDashboard";
import MapPage from "./pages/MapPage";
import NatureCulture from "./pages/NatureCulture";
import Establishment from "./pages/Establishments";

function App() {
  const user = JSON.parse(localStorage.getItem("user") || "null");

  return (
    <Router>
      <Routes>
        {/* Public routes */}
        <Route path="/login" element={<LoginPage />} />
        <Route path="/signup" element={<SignupPage />} />

        {/* Protected routes */}
        <Route
          path="/home"
          element={user ? <Home /> : <Navigate to="/login" />}
        />
        <Route
          path="/mappage"
          element={user ? <MapPage /> : <Navigate to="/login" />}
        />
        <Route
          path="/natureculture"
          element={user ? <NatureCulture /> : <Navigate to="/login" />}
        />
        <Route
          path="/establishment"
          element={user ? <Establishment /> : <Navigate to="/login" />}
        />
        <Route
          path="/admindashboard"
          element={user && user.role === "admin" ? <AdminDashboard /> : <Navigate to="/login" />}
        />

        {/* Default route */}
        <Route path="*" element={<Navigate to="/home" />} />
      </Routes>
    </Router>
  );
}

export default App;
